currentDoc:
An alien has kidnapped Matt Damon, not knowing what lengths humanity goes through to retrieve him whenever he goes missing. 

Matt Damon is currently on a spaceship with the alien. He is behind a forcefield. He asks the alien why him. The alien says he is a huge fan of him. He says his planet can see our planet perfectly fine and they basically know what we do without us knowing. They also know what are movies are like. The alien says he loves every movie Matt Damon is in. And he broke their planets laws about interfering with humanity because he is so in love.  He says Matt Damon is his soul mate and he wishes he could be like him. The alien continues to fly but has to make as stop at a powerplant to charge up the spaceship before he can take Matt Damon back to his planet.

Meanwhile humanity is trying to get Matt Damon back to safety before the alien takes him away forever. They go through a lot of trouble trying to find where the alien went. Sudden;

